                {listData.map((data) => <tr><td>{data.couponCode}</td><td>{new Date(data.dateCreated * 1000).toString()}</td><td>{data.targetAddress}</td><td>{Web3.utils.fromWei(data.totalEth,"ether")}</td><td>{new Date(data.startDate*1000)}</td><td>{new Date(data.endDate*1000)}</td><td>{Web3.utils.fromWei(data.amtPerAddress,"ether")}</td><td>{Web3.utils.fromWei(data.minRedeemAmt,"ether")}</td><td>{Web3.utils.fromWei(data.maxRedeemAmt,"ether")}</td></tr>)}
                {/* {listData.map((data) => <tr><td>{data.couponCode}</td><td>{data.dateCreated}</td><td>{data.targetAddress}</td><td>{data.totalEth}</td><td>{data.startDate}</td><td>{data.endDate}</td><td>{data.amtPerAddress}</td><td>{data.minRedeemAmt}</td><td>{data.maxRedeemAmt}</td></tr>)} */}
              </tbody>
            </table>
        {/* </div>
            <h1>Who lives in my garage?</h1>
            <ul>
            {listData.map((data) => data.sponsorAddress)}
            </ul> */}
          </>
        );
    }
}

